import React from 'react'
import { motion } from 'framer-motion';
import styled from 'styled-components';
const firstBox = {
  hidden: { scaleY: 0, transformOrigin: "bottom" },
  visible: { scaleY: 1, transformOrigin: "bottom" },
  exit: { scaleY: 0, transformOrigin: "bottom" }
};

const secondBox = {
  hidden: { scaleY: 0, transformOrigin: "top" },
  visible: { scaleY: 1, transformOrigin: "top" },
  exit: { scaleY: 0, transformOrigin: "top" }
};

const Photos = () => {
  return (
    <StyledPhotos>
        <motion.div 
        className="first-box box" 
        variants={firstBox}
        initial="hidden"
        animate="visible"
        exit="exit"
        transition={{ duration: 0.5 }}
      />
      <motion.div 
        className="second-box box" 
        variants={secondBox}
        initial="hidden"
        animate="visible"
        exit="exit"
        transition={{ duration: 0.5 }}
      />
    </StyledPhotos>
  )
}

const StyledPhotos = styled(motion.div)`
  .box{
    width: 50%;
    height: 100vh;
    background-color: black;
  }
  .second-box{
    margin-left: 300px;
  }
`
export default Photos
